def print_grid_traversal(graph, n, trav=[]):
   
    def index(r, c):
        return r*n + c
    
    m = len(graph) // n
    
    for i in range(m):
        for j in range(n):
            k = index(i, j)
            if k in trav:
                print("{0:0>3}".format(trav.index(k)), end='')
            else:
                print('***', end='')
            if j < n-1 and graph[k][index(i, j+1)] and graph[index(i, j+1)][k]:
                print('---', end='')
            elif j < n-1 and graph[k][index(i, j+1)]:
                print('-->', end='')
            elif j < n-1 and graph[index(i, j+1)][k]:
                print('<--', end='')
            else:
                print('   ', end='')
        print('\n', end='')
        if i < m - 1:
            for j in range(n):
                k = index(i, j)
                if j == 0:
                    print(' ', end='')
                if graph[k][index(i + 1, j)] and graph[index(i + 1, j)][k]:
                    print('|', end='')
                elif graph[k][index(i + 1, j)]:
                    print('\u21E3', end='')
                elif graph[index(i + 1, j)][k]:
                    print('\u21E1', end='')
                else:
                    print(' ', end='')
                if j < n-1:
                    print('     ', end='')
            print('\n', end='')


def neighbours(v, graph):
    return [j for j in range(len(graph)) if graph[v][j]]
